                AbstractC23559gye.x(c21488fQg, null, "CREATE TABLE IF NOT EXISTS Story (\n    _id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,\n    storyId TEXT NOT NULL,\n    userName TEXT, -- Deprecated. Use userId column instead.\n    displayName TEXT,\n    isLocal INTEGER,\n    profileDescription TEXT,\n    sharedId TEXT,\n    latestTimeStamp INTEGER, -- DEPRECATED. Use field in StoryViewActiveSnap.\n    latestExpirationTimestamp INTEGER, -- DEPRECATED. Use field in StoryViewActiveSnap.\n    viewed INTEGER, -- DEPRECATED. Use field in StoryViewActiveSnap.\n    kind INTEGER NOT NULL,\n    groupStoryType INTEGER,\n    isPostable INTEGER,\n    rankingId INTEGER, -- Ranking number returned from server for priority of this story. Lower is higher priority.\n    lastSyncRequestId TEXT, -- requestId of the last friend stories sync which updates this story (including ranking order updates).\n\n    -- story's sequence numbers used in delta fetch.\n    -- See https://docs.google.com/document/d/1uqIHEo8HX7UbOQtrMWHJIO9XcbPnKJznIctlNL1d0aA\n    minSequence INTEGER, -- the story's min sequence number on the server\n    maxSequence INTEGER, -- the story's max sequence number on the server\n    lastSyncMaxSequence INTEGER, -- the story's max sequence number (inclusive) synced to client,\n    userId TEXT, -- is friend's userId for StoryKind.FRIEND stories and is NULL for other story kinds\n    adOrganicSignals BLOB, -- realtime organic engagement signals used for ad requesting\n    hpoData TEXT, -- hpoData of the last friend stories sync which updates this story (including ranking order updates).\n    isFriendOfFriend INTEGER, -- if content is populated from friend of friends\n\n    UNIQUE(storyId, kind)\n)");
                AbstractC23559gye.x(c21488fQg, null, "CREATE TABLE IF NOT EXISTS StorySnap (\n    _id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,\n    snapRowId INTEGER NOT NULL,\n    username TEXT,\n    clientId TEXT NOT NULL,\n    storyRowId INTEGER NOT NULL,\n\n    captionTextDisplay TEXT,\n    filterId TEXT,\n    thumbnailUrl TEXT,\n    largeThumbnailUrl TEXT,\n    viewed INTEGER, -- true if the snap has been viewed\n    isPublic INTEGER,\n    mediaD2sUrl TEXT,\n    needAuth INTEGER NOT NULL,\n    storyFilterId TEXT,\n    thumbnailIv TEXT,\n    canonicalDisplayTime INTEGER,\n    expirationTimestamp INTEGER,\n    venueId TEXT,\n    flushableId TEXT, -- used to report read, screenshot, save states to servers\n    -- DEPRECATED(In mixer we join from username to get the displayName of the user)\n    -- Mixer will not populate this field and rely on the Friend table displayName for the info.\n    displayName TEXT, -- used for showing the display name of the snap's attributed user.\n    snapAttachmentUrl TEXT, -- used for URL attachments\n    contextHint TEXT, -- used for Context Cards\n    animatedSnapType TEXT, -- whether the snap contained animations, for analytics\n    lensMetadata TEXT, -- metadata for lenses analytics\n    filterLensId TEXT, -- metadata for lenses analytics\n    lensRankingId TEXT DEFAULT NULL, -- metadata for lenses analytics\n    unlockablesSnapInfo TEXT, -- metadata for unlockables analytics\n    encryptedGeoLoggingData TEXT, -- encrypted metadata about geo logging, for analytics\n    ruleFileParams TEXT, -- serialized map for controlling media quality for direct-to-storage downloads\n    brandFriendliness INTEGER, -- Brand friendliness from server story snap\n    clientStatus INTEGER,\n\n    friendScreenCaptureRecordingCount INTEGER,\n    friendScreenCaptureShotCount INTEGER,\n    friendScreenshotCount INTEGER,\n    friendSnapSaveCount INTEGER,\n    friendViewCount INTEGER,\n    otherScreenCaptureRecordingCount INTEGER,\n    otherScreenCaptureShotCount INTEGER,\n    otherScreenshotCount INTEGER,\n    otherSnapSaveCount INTEGER,\n    otherViewCount INTEGER,\n\n    pendingServerConfirmation INTEGER, -- whether posts are waiting to be confirmed by StoriesResponse\n    postedTimestamp INTEGER, -- used for posting timeout logic for detecting async posting failures\n\n    creationTimestamp INTEGER, -- used to display original creation time when posting from memories / camera roll\n    snapSource INTEGER, -- used to determine source when posting from memories / camera roll\n\n    creativeKitSourceAppName TEXT, -- used to display source app name when posting from Snap Kit Creative Kit\n    creativeKitSourceAppOAuthClientId TEXT, -- used to identify source app when posting from Snap Kit Creative Kit\n\n    serverRankingId TEXT, -- used for story story view blizzard event\n    -- story snap's sequence number used in delta fetch.\n    -- See https://docs.google.com/document/d/1uqIHEo8HX7UbOQtrMWHJIO9XcbPnKJznIctlNL1d0aA\n    sequence INTEGER,\n    -- ID used for fetching view count information for Our Story snaps\n    ourStoriesSnapId TEXT,\n\n    -- serialized SnapDocPersistenceWrapper client proto for fetching story snap media content via Bolt\n    boltInfo BLOB DEFAULT NULL,\n\n    -- userId of the poster. Custom stories have multiple posters so\n    -- we need to use poster's userId in StorySnap instead of Story.\n    userId TEXT,\n\n    -- Bolt CO thumbnail fields.\n    thumbnailContentObject BLOB DEFAULT NULL,\n    thumbnailCoKey TEXT,\n    thumbnailCoIv TEXT,\n\n    -- Spotlight counts\n    boostCount INTEGER,\n    shareCount INTEGER,\n\n   -- MultiSnap metadata\n   multiSnapBundleId TEXT,\n   multiSnapSegmentCount INTEGER,\n   multiSnapSegmentId INTEGER,\n\n   -- Set if snap was posted to Spotlight and/or Our Story\n   -- [ourStoryDestination] is deprecated, please use [ourStoryDestinations]\n   -- https://jira.sc-corp.net/browse/STORIES-23298\n   ourStoryDestination INTEGER, -- deprecated\n   ourStoryDestinations BLOB,\n\n   -- Set if snap was posted to Spotlight\n   spotlightSnapStatus INTEGER,\n\n   isTimeline INTEGER,\n\n    -- Used for arroyo story posting to identify snaps when retrying failed story snap sending.\n    taskQueueId TEXT,\n\n    -- Optionally added to story snap at posting time.\n    description TEXT DEFAULT NULL,\n\n    -- Spotlight subscription count\n    subscribeCount INTEGER,\n\n    -- Cameos specific params\n    bloopsGenders TEXT DEFAULT NULL,\n\n    -- Information about the sponsor of the story\n    sponsorProfileId TEXT DEFAULT NULL,\n    sponsorDisplayName TEXT DEFAULT NULL,\n\n    -- Spotlight replies counts\n    liveRepliesCount INTEGER,\n    pendingRepliesCount INTEGER,\n    newPendingRepliesCount INTEGER,\n\n    -- Rewatch counts\n    rewatchCount INTEGER,\n\n    -- If this Snap (My Story only) has been reposted to Spotlight an id will be stored here\n    spotlightRepostId TEXT DEFAULT NULL,\n\n    -- Set if snap was rejected on Spotlight\n    spotlightRejectionReason INTEGER,\n\n    -- How many times this snap has been remixed\n    remixCount INTEGER,\n\n    -- Status of the sponsor tagging\n    -- It should use values of https://github.sc-corp.net/Snapchat/pb_schema/blob/5171d124e77f5e4d2c572147ec5a5d558e68bd44/proto/snapdoc/sponsor.proto#L31\n    sponsorStatus INTEGER DEFAULT 0,\n\n    -- Moderation data for the snap, stored as a ByteArray (encoded ContentModerationStatus proto)\n    encodedContentModerationStatus BLOB DEFAULT NULL,\n\n    -- Recommend Button Info https://snapchat.quip.com/69QGAVrLS2YZ\n    isRecommended INTEGER DEFAULT NULL,\n    isRecommendedTimestampMs INTEGER DEFAULT NULL,\n    recommendCount INTEGER,\n\n    -- Brand friendliness V2 from server story snap\n    garmBrandSafety INTEGER DEFAULT NULL,\n\n    displayTimestamp INTEGER, -- used to display timestamp(configured by server)\n\n    -- (storyRowId, clientId) should be unique and consistent across local and server synced snaps\n    UNIQUE(storyRowId, clientId),\n\n    -- should have unique snapRowId for each story\n    UNIQUE(storyRowId, snapRowId)\n)");
